import React, { useState, useCallback } from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import TablePay from './TablePayment';
import FormPayProducts from './FormPay';
import { Products } from '../generalRequest/Products';
import axios from 'axios';

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const Div = styled('div')(({ theme }) => ({
  ...theme.typography.button,
  backgroundColor: theme.palette.background.paper,
  padding: theme.spacing(1),
}));

export default function AutoGrid() {

  const [datos, setDatos] = useState([])
  const [products, setProducts] = useState([])
  const [numOrder, setNumOrder] = React.useState('');

  const handleChangeOrder = (event) => {
    setNumOrder(event.target.value);
  };

  console.log('products', products)
  console.log('datos', datos)

  const accessToken = 'eyJhbGciOiJIUzUxMiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJwUGFINU55VXRxTUkzMDZtajd ZVHdHV3JIZE81cWxmaCIsImlhdCI6MTYyMDY2Mjk4NjIwM30.lhfzSXW9_TC67SdDKyD bMOYiYsKuSk6bG6XDE1wz2OL4Tq0Og9NbLMhb0LUtmrgzfWiTrqAFfnPldd8QzWvgVQ';
  const apiURL = 'https://eshop-deve.herokuapp.com/api/v2/orders';

  return (
    <Box sx={{ flexGrow: 1 }} m={5}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Item>
            <Div>{"Agregar producto"}</Div>
            <FormPayProducts datos={datos} setDatos={setDatos} />
          </Item>
        </Grid>

        <Grid item xs={12}  align-items='left' align='left'>
          <Item align-items='left' align='left'>
          <FormControl sx={{ m: 1, minWidth: 230 }} size="small">
            <InputLabel id="demo-select-small">Número de orden</InputLabel>
            <Select
              labelId="demo-select-small"
              id="demo-select-small"
              value={numOrder}
              label="numOrder"
              onChange={handleChangeOrder}
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              <MenuItem value={10}>Ten</MenuItem>
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
          </Item>
        </Grid>

        <Grid item xs={12}>
          <Item>
            <Div>{"Listado de productos"}</Div>
            <TablePay products={datos} />
          </Item>
        </Grid>
        <Grid item xs={12}>
          <Item>
            <Products setProducts={setProducts} products={products}/>
          </Item>
        </Grid>
      </Grid>
    </Box>
  );
}
